import { NextRequest, NextResponse } from 'next/server';

export async function GET(request: NextRequest) {
  const { searchParams } = new URL(request.url);
  const color = searchParams.get('color');

  if (!color) {
    return NextResponse.json(
      { error: 'color parameter is required' },
      { status: 400 },
    );
  }

  const svgData = `
    <svg width="48" height="48" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
      <circle cx="24" cy="24" r="24" fill="#${color}"/>
      <mask id="mask0_1893_21" style="mask-type:alpha" maskUnits="userSpaceOnUse" x="0" y="0" width="48" height="48">
        <circle cx="24" cy="24" r="24" fill="#${color}"/>
      </mask>
      <g mask="url(#mask0_1893_21)">
        <path d="M50.1818 -2.18176H-2.18188V50.1819H50.1818V-2.18176Z" fill="url(#pattern0_1893_21)"/>
      </g>
      <defs>
        <pattern id="pattern0_1893_21" patternContentUnits="objectBoundingBox" width="1" height="1">
          <use xlink:href="#image0_1893_21" transform="scale(0.00217391)"/>
        </pattern>
        <image id="image0_1893_21" width="460" height="460" xlink:href="data:image/png;base64,"/>
      </defs>
    </svg>`;

  const svgBase64 = btoa(svgData);
  const faviconURL = `data:image/svg+xml;base64,${svgBase64}`;

  return NextResponse.json({ data: faviconURL });
}
